import React, {useState} from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";

export default function MedicationInput() {
    const [medication, setMedication] = useState("");
    const [dose, setDose] = useState("");

    const handleSubmit = e => {
        e.preventDefault();
        console.log(medication, dose);
    };

    return (
        <form onSubmit={handleSubmit}>
            <Box
                sx={{
                    "& .MuiTextField-root": {mb: 5, width: "100%"},
                }}
                noValidate
                autoComplete="on"
            >
                <div>
                    <TextField
                        required
                        id="medicationInput"
                        name="medicationInput"
                        label="Medication"
                        type="search"
                        helperText="Input your medication's name"
                        value={medication}
                        onChange={e => setMedication(e.target.value)}
                    />
                    <br/>
                    <TextField
                        required
                        id="doseInput"
                        name="doseInput"
                        label="Dose"
                        type="number"
                        helperText="Input your medication's dosage in mg"
                        value={dose}
                        onChange={e => setDose(e.target.value)}
                    />
                </div>

                <Button variant="contained" size="large" type="submit"
                        sx={{fontSize: "17px", height: "5.75ch", width: "100%"}}>Submit</Button>
            </Box>
        </form>
    );
}
